package gmibank.pages;import gmibank.utilities.Driver;import org.openqa.selenium.WebElement;import org.openqa.selenium.support.FindBy;import org.openqa.selenium.support.PageFactory;public class US_11_Page {    public US_11_Page() {        PageFactory.initElements(Driver.getDriver(),this);    }    @FindBy(xpath = "//a[@aria-haspopup='true']")    public WebElement enterIcon;    @FindBy(xpath = "//span[.='Sign in']")    public WebElement signinLink;    @FindBy(id = "username")    public WebElement username;    @FindBy(id = "password")    public WebElement password;    @FindBy(xpath = "//button[@class='btn btn-primary']")    public WebElement signInButton;    @FindBy(xpath = "//span[.='My Operations']")    public WebElement myOperationsLink;    @FindBy(xpath = "//span[.='Manage Customers']")    public WebElement manageCostomersLink;    @FindBy(xpath = "//span[.='Create a new Customer']")    public WebElement createNewCostomersLink;    @FindBy(linkText = "#")    public WebElement userInfoLink;    @FindBy(xpath = "//span[.='Sign out']")    public WebElement signoutLink;    @FindBy(id = "tp-customer-createDate")    public WebElement createDateBox ;    @FindBy (id = "tp-customer-user")    public WebElement userDropdownBox;    @FindBy (id = "tp-customer-account")    public WebElement accountDropdownBox;    @FindBy (id = "tp-customer-zelleEnrolled")    public WebElement zelleEnrolledCheckBox;    @FindBy (id = "save-entity")    public WebElement saveButton;}